  false,\n\t\"url\": null,\n\t\"notes\": \"INDEX24 contains 1:24,000 scale neatlines
  for USGS 7.5 minute quadrangle maps covering Acadia National Park's GIS project
  area in Maine. The index was originally generated by MEGIS staff using the known
  coordinates for the corners of the USGS 7.5 minute map series. The items NAME and
  TILE-NAME carry the MEGIS library tile name in title case and lower case. Names
  are identical in most cases to the USGS official name for each 1:24000 scale quadrangle.
  Z names, for areas of Maine where data but no USGS quadrangle names exist, are also
  included. INDEX24 is the coverage 24KINDEX renamed and projected to NAD83.\",\n\t\"license_title\":
