  in detailed studies and local planning; and at 1:12,000 and 1:5,000 or larger scales
  in parcel level studies and detailed local planning. In the use of Maine GIS data,
  please check sources, scale, accuracy, currentness and other available information.
  Please confirm that you are using the most recent copy of both data and metadata
